// Render danh mục
const categoriesEl = document.getElementById("categories");
categories.forEach((c) => {
  const div = document.createElement("div");
  div.className = "cat";
  div.innerHTML = `
    <img src="${c.img}" alt="${c.name}">
    <span>${c.name}</span>
  `;
  div.addEventListener("click", () => filterByCategory(c.id));
  categoriesEl.appendChild(div);
});

// Render sản phẩm
const productGrid = document.getElementById("productGrid");
function renderProducts(list) {
  productGrid.innerHTML = "";
  list.forEach((p) => {
    const card = document.createElement("div");
    card.className = "card";
    card.innerHTML = `
      <img src="${p.img}" alt="${p.title}">
      <h3>${p.title}</h3>
      <p>${p.price.toLocaleString()} đ</p>
      ${
        p.oldPrice
          ? `<small style="text-decoration:line-through">${p.oldPrice.toLocaleString()} đ</small>`
          : ""
      }
      <button>Thêm vào giỏ hàng</button>
    `;
    productGrid.appendChild(card);
  });
}

function filterByCategory(catId) {
  const filtered = products.filter((p) => p.category === catId);
  renderProducts(filtered);
}

// Hiển thị tất cả sản phẩm khi load
renderProducts(products);
